import { useSelector } from "react-redux";
import UserCard from "./user_card";
function UserList() {
  const user = useSelector((state) => state.userlistReducer.users);
  return (
    <div>
      {user.map((el) => (
        <UserCard el={el} />
      ))}
    </div>
  );
}
export default UserList;
